import React, { Component } from "react";
// import ProductItem from "./ProductItem";

class ProductPage extends Component {
  constructor() {
    super();
    this.state = {
      allPosts: [
  {
    "id": 1,
    "title": "My First Post",
    "body":
      "Lugger hornswaggle boatswain lugsail coxswain gally gangplank Letter of Marque fluke ballast. Hang the jib spyglass nipperkin chase guns ho salmagundi quarterdeck scallywag six pounders Davy Jones' Locker. Skysail case shot hail-shot scurvy gaff crimp fathom rope's end Plate Fleet black spot. Aft avast brigantine topsail line matey Sink me killick measured fer yer chains Brethren of the Coast. Lad Jack Tar capstan handsomely mizzen crimp gangplank lugger nipper chase. Lugger rum pillage square-rigged tack heave to cog quarterdeck booty Arr."
  },
  {
    "id": 2,
    "title": "My Second Post",
    "body":
      "Run a shot across the bow sheet mizzen doubloon black spot pillage matey yard prow lugger. Barbary Coast ballast gaff aye heave to jib killick belaying pin galleon carouser. Mizzenmast Admiral of the Black keel pinnace spike bowsprit parley keelhaul Shiver me timbers scurvy. Booty gangplank long clothes reef sails grog blossom rope's end cable black jack salmagundi maroon. Smartly sheet jack aye yo-ho-ho rum furl walk the plank Plate Fleet ye. Letter of Marque aft fore booty schooner keelhaul American Main scuttle fire ship Yellow Jack."
  },
  {
    "id": 3,
    "title": "My Third Post",
    "body":
      "Galleon pressgang shrouds provost fathom bring a spring upon her cable Blimey strike colors pinnace draught. Handsomely bilged on her anchor marooned yo-ho-ho Brethren of the Coast sutler nipper jack American Main haul wind. Dead men tell no tales cutlass port broadside tack gibbet weigh anchor parrel hornswaggle Pirate Round. Run a rig walk the plank yardarm sloop loaded to the gunwalls Davy Jones' Locker lookout poop deck run a shot across the bow hang the jib. Overhaul heave to plunder ballast aft rutters red ensign warp chase trysail. Loot salmagundi provost black spot ho Plate Fleet brig wench sutler Chain Shot."
  },
  {
    "id": 4,
    "title": "My Fourth Post",
    "body":
      "Interloper Brethren of the Coast cackle fruit lookout cutlass snow pillage flogging Sink me no prey, no pay. Reef ho mizzenmast quarter lee case shot snow Admiral of the Black holystone heave down. Cackle fruit salmagundi prow ye cutlass bucko black spot maroon fire in the hole scourge of the seven seas. Case shot cog cutlass rope's end boatswain pirate man-of-war gunwalls Yellow Jack fore. Gangplank lad spanker hail-shot lugger grog hulk long boat hang the jib pinnace. Gun overhaul skysail Sink me smartly brig clipper hulk nipper draft."
  },
  {
    "id": 5,
    "title": "My Fifth Post",
    "body":
      "Pieces of Eight boom ballast Pirate Round ye parley Privateer matey topmast sheet. Sheet parrel yawl nipperkin stern fluke cutlass swing the lead Barbary Coast scuttle. Flogging rigging wench Privateer tender booty trysail stern Corsair aft. Barkadeer Plate Fleet gabion holystone aye barque hempen halter no prey, no pay Pieces of Eight salmagundi. Belay heave down bilge lee Davy Jones' Locker fire ship ahoy boatswain port hang the jib. Maroon gally gibbet take a caulk Spanish Main come about jury mast sutler measured fer yer chains tack."
  }
]
    };
  }

  render() {
    const { products } = this.state;
    const listItems = products.map(product => {
      return (
        <Feed
          name={product.name}
          manufacturer={product.manufacturer}
          price={product.price}
        />
      );
    });
    return (
      <React.Fragment>
        <ul>{listItems}</ul>
      </React.Fragment>
    );
  }
}

export default ProductPage;
